/**JEDEMO例子样式*/
.data-list-tile .je-list-view {
    display: box;
    display: -webkit-box;
    display: -webkit-flex;
    display: -moz-box;   
    display: -ms-flexbox;
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
  	align-content:flex-start
}
.data-list-tile .je-list-view  .je-list-item-wrap {
  border-radius: 10px;
}
.data-list-tile .je-list-view .je-list-item-wrap.je-list-item-over,.data-list-tile .je-list-view .je-list-item-wrap.je-list-item-selected{
  background-color: transparent;
}
.data-list-tile .dataCard {
  display: box;
  display: -webkit-box;
  display: -webkit-flex;
  display: -moz-box;   
  display: -ms-flexbox;
  display: flex;
  width: 400px;
  max-height: 180px;
  border-radius: 10px;
  border: 1px solid #f7f0f0;
}
.data-list-tile .dataCard._ss-hover {
  box-shadow: #cee8e7 2px 2px 10px;
}
.data-list-tile .dataCard .leftdiv {
  position: relative;
  padding-top: 100px;
  text-align: center;
  width: 120px;
}
.data-list-tile .dataCard .leftdiv .headerImg {
      position: absolute;
      top: 20px;
      left: 50%;
      margin-left: -30px;
      width: 60px;
      height: 60px;
      line-height: 60px;
      border-radius: 50%;
      background-color: #ffb029;
     color: #fff;overflow:hidden;
}
.data-list-tile .dataCard .je-user-photo {
      width: 100%;
      height: 100%;
      border-radius: 50%;
}
.data-list-tile .dataCard .leftdiv .name {
      font-size: 16px;
      font-weight: 600;
}
.data-list-tile .dataCard .leftdiv .duty {
      font-size: 14px;
      color: #999;
      margin-top: 5px;
}
.data-list-tile .dataCard .leftdiv .jeicon {
      position: absolute;
      top: 65px;
      left: 75px;
}
.data-list-tile .dataCard .leftdiv .jeicon-men {
      color: #386bd0;
}
.data-list-tile .dataCard .leftdiv .jeicon-women {
      color: #f367ee;
}
.data-list-tile .dataCard .centerline {
      width: 1px;
      background-color: #ccc;
      height: 100px;
      margin-top: 40px;
}
.data-list-tile .dataCard .rightdiv {
      -prefix-box-flex: 1;
      -webkit-box-flex: 1;
      -webkit-flex: 1;
      -moz-box-flex: 1;
      -ms-flex: 1;
      flex: 1;
      padding: 15px 10px;
}
.data-list-tile .dataCard .rightdiv .item{
      padding: 8px;
      font-size: 15px;
}
.data-list-tile .dataCard .rightdiv .item .label{
      padding-right: 20px; 
      color: #999;
}
.data-list-tile .dataCard .rightdiv .item .note{
  color: #333;
}
.je-field-showField{
  background-color: rgb(255, 244, 206);
  color: rgb(69, 143, 166);
  font-family: tahoma, 微软雅黑;
  font-weight: bold;
  line-height: normal;
  padding: 10px;
  border-radius: 4px 0px 0px 4px;
  border-left: 5px solid rgb(255, 153, 51) !important;
}
/**字体加粗*/
.je-email-font-b .x-grid-cell{
	font-weight: bold !important;
}

/**颜色变红*/
.row-sys-red .x-grid-cell{
       background-color:#FF8040 !important;
       color:black;
}
.func-row-sys-red {
       color:black;
}
.row-sys-red .x-grid-cell-inner-row-numberer{
   color:black;
}


/**颜色变黄*/
.row-sys-yellow .x-grid-cell{
       background-color:#F9F900 !important;
       color:black;
}
.func-row-sys-yellow {
       color:black;
}
.row-sys-yellow .x-grid-cell-inner-row-numberer{
   color:black;
}

